const ServiceTitle = styled(SectionTitle)`
  margin: 30px 0px;
`;

const RightServiceTitle = styled(ServiceTitle)`
text-align: right;
`;

const FlexRow = styled("div")`
  display: flex;
  justify-content: space-around;
  align-items: center;
  margin: 60px 0px;
  width: 100%;
`;

const Description = styled("p")`
  ont-weight: normal;
  font-size: 16px;
  line-height: 22px;
  margin: 30px 0px;
  max-width: 500px;
  flex: 1;
`;

const RightDescription = styled(Description)`
  text-align: right;
`;

const Image = styled('img')`
max-width: 550px;
flex: 1;
`;

const WeAreContent = () => {
  return (
    <>
      <DefaultSection>
        <SectionTitle>Our Services</SectionTitle>
        <CenteredText>
          Lorem ipsum dolor sit amet consectetur adipiscing elit sodales primis,
          mollis viverra conubia ligula inceptos laoreet.
